import { BiLogoFacebook, BiLogoInstagram, BiLogoPinterest } from 'react-icons/bi'

const socialData = [
    {
        title: "Facebook",
        icon: <BiLogoFacebook />,
        link: ""
    },
    {
        title: "Instagram",
        icon: <BiLogoInstagram />,
        link: ""
    },
    {
        title: "Pinterest",
        icon: <BiLogoPinterest />,
        link: ""
    },
    {
        title: "X",
        icon: <BiLogoInstagram />,
        link: ""
    },
    {
        title: "TikTok",
        icon: <BiLogoInstagram />,
        link: ""
    },
    {
        title: "YouTube",
        icon: <BiLogoInstagram />,
        link: ""
    }
]

export default socialData
